import './App.css';
import React, {useState} from 'react';
import Header from "./Components/Header/Header.js";
import OptionsBar, {buttonClicked} from "./Components/OptionsBar/OptionsBar.js";
import HomeScreen from "./Containers/HomeScreen/HomeScreen.js";
import headshot from './Assets/Headshot.png';

function App() {

  const {buttonClicked} = require('./Components/OptionsBar/OptionsBar.js');

  return (
    <div className="App">
      <Header />
      <OptionsBar />
      <div>{OptionsBar.buttonClicked}</div>
      {OptionsBar.buttonClicked == 1 ?
      <HomeScreen />
      : <div> test </div>}
      {buttonClicked}
    </div>

  );
}

export default App;
